import React from "react";

function app() {
    const newPost = {
        "userId": 1,
        "id": 7777777777,
        "title": "hello",
        "body": "ceva pa frantuzki"
      }
    fetch('https://jsonplaceholder.typicode.com/posts', {
        method: 'GET',
        // body: newPost,   
    }
    ).then((data) =>{
        if(data.status === 200) {
            return data.json();
        }
        else {
            console.error('Its not ok!')
        }
        console.log(data)
        }).then((info => {
            console.log(info)
        }))
    }

export default app
